import React from 'react';
import TextField from '@material-ui/core/TextField';
import Autocomplete from '@material-ui/lab/Autocomplete';

import api from '../../services/api';

import heroes from '../../heroes';
import Logo from '../../components/Logo';


import {
  Container
} from './styles'

interface IHeroe {
  id: number;
  name: string;
}

const Home: React.FC = () => {
  const options = ['Option 1', 'Option 2'];
  const [value, setValue] = React.useState(heroes[0]);
  const [inputValue, setInputValue] = React.useState(heroes[0]);

  return (
    <>
      <Container>
        <Logo />
        <Autocomplete
          value={value}
          onChange={(event, newValue) => {
            setValue(newValue || heroes[0]);
          }}
          inputValue={inputValue}
          onInputChange={(event, newInputValue: IHeroe) => {
            setInputValue(newInputValue);
          }}
          id="controllable-states-demo"
          options={heroes}
          style={{ width: "70%", padding: "10px", border: "#6495ED", background: "#6495ED" }}
          renderInput={
            (params) =>
              <TextField style={{ background: "#6495ED" }} {...params} label="Super Heroi" variant="outlined" />
          }
        />
      </Container>
    </>
  );
};

export default Home;
